import React from 'react';
import { Link } from 'react-scroll';
import bg from '../../assets/meg.jpeg';
import btnimg from '../../assets/suitcase.jpg';
import './intro.css';

const Intro = () =>{
    return(
        <section id="intro">
            <div className="introContent">
                <span className="hello">Hello, </span>
                <span className="introText">I`m <span className='introName'>Ingrid</span> <br />Developer</span>

                <p className="introPara"> I study for a bachelor in informatics:programming and system architecture at University of Oslo.</p>
                <Link>
                <button className="btn">
                    <img scr = {btnimg} alt= "Hire me" />
                    </button>
                </Link>
            </div>
            <img src={bg} alt="Profile" className="bg"></img>
        </section>
    )

}

export default Intro;
